import React from 'react';
import './App.css';

function App() {
  return (
    <div className='App'>
      <div className="first-vertical">
        <div className="first-half">
          <div className="looking-for-a-lollip">Looking for a lollipop alternative?</div>
          <div className="body">Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s.</div>
          <div style={{float:'left'}}>
            <button className="bg cta-text">Primary CTA</button>{' '}
            <button className="outline second-cta-text">Secondary CTA</button>{' '}
          </div>
        </div>
        <div className="second-half">
          <img src={require('./assets/images/globe.png')}></img>
        </div>
      </div>

      <div>asdasd</div> 
        <div>adasd</div> 
        <div>asd</div> 
        <div>sad</div>    
        <div>sadasd</div> 
        <div>asd</div> 
      <div className="second-vertical">
        <img className="central-img" src={require('./assets/images/BG/png/BG.png')}></img>
        <div className="this-is-a-heading-in">This is a heading in <br></br>two lines</div>
        <img className="overlay-img" src={require('./assets/images/Group 6/png/Group_6.png')}></img>
      </div>
    </div>    
  );
}

export default App;
